import icons from "./images/icons/";

const typeColors = {
  electric: { color: "yellow", image: "./images/icons/electric.svg" },
  water: { color: "blue", image: "/images/icons/water.png" },
  fire: { color: "red", image: "/images/icons/fire.png" },
  grass: { color: "green", image: "/images/icons/grass.png" },
  ground: { color: "brown", image: "/images/icons/ground.png" },
  normal: { color: "gray", image: "/images/icons/normal.png" },
};

export default typeColors;
